import React from "react";
import { Component } from "react";

class ExpenseItem extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: "Ovidiu",
        },
        {
          name: "Sabina",
        },
        {
          name: "Mihaela",
        },
      ],
    };
  }

  render() {
    return (
      <div>
        {this.state.monsters.map((monster) => {
          return <h1>{monster.name}</h1>;
        })}
      </div>
    );
  }
}

export default ExpenseItem;
